final List<dynamic> styles = [':host {\n  margin: 0.5em;\n}\n\nmaterial-button:not([icon]) {\n  min-width: 42px;\n  margin: 0;\n}\nmaterial-button:not([icon]) > .content {\n  padding: 0;\n}\n\n.title, .weektitle, .week {\n  display: flex;\n  flex-direction: row;\n}\n\n.title {\n  background-color: #006064;\n  color: #fff;\n  border-top-left-radius: 0.5em;\n  border-top-right-radius: 0.5em;\n  justify-content: center;\n  padding: 0.5em;\n}\n\n.weektitle, .weekmarks {\n  background-color: #006064;\n  color: #fff;\n}\n\n.month {\n  background-color: #00bcd4;\n  color: #000;\n  display: flex;\n  flex-direction: column;\n  /*! @noflip */\n  box-shadow: 0 4px 5px 0 rgba(0, 0, 0, 0.14), 0 1px 10px 0 rgba(0, 0, 0, 0.12), 0 2px 4px -1px rgba(0, 0, 0, 0.2);\n}\n\n.week material-button {\n  width: 10px;\n}\n.week material-button[raised]:not(.key) {\n  background-color: #0097a7;\n}\n.week material-button[raised].key {\n  background-color: #0b8043;\n}\n.week material-button[raised]:not(.key):not([disabled]) {\n  color: #000;\n}\n.week material-button[raised].key:not([disabled]) {\n  color: #fff;\n}\n\n.done ::ng-deep .content, .close ::ng-deep .content {\n  padding-top: 0.05em !important;\n  padding-bottom: 0.05em !important;\n}\n\n.done {\n  color: #aed581;\n  background: #006064;\n}\n\n.close {\n  color: #eda29b;\n  background: #db4437;\n}\n'];